import React from 'react'
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Page1 from './adpage1'
import { Link } from 'react-router-dom';

function App() {
  return (

    <div>


      <Route
        path="/"
        element={<Page1 />}
      />
      <Link to="/adpage1">
        <button>Admin</button>
      </Link>
      <Route/>;

    </div>

  );
}

export default App
